import React, { Component } from 'react';
import Header from '../components/Header';


class Home extends Component {
  render() {
    return (
      <div data-testid="page-search" className='bg-black text-white font-bold'>
        <aside className='p-4 font-semibold text-zinc-400 w-1/4 p-4 font-semibold text-zinc-400 w-1/6 bg-opacity-10 bg-white'>
          <nav className=' p-2 text-xs font-semibold '>
            <Header />


          </nav>

        </aside>


      </div>
    );
  }
}

export default Home;
